        sum := add(x, y)

        // overflow, if x >= 0 and sum < y
        // underflow, if x < 0 and sum >= y
        if or(
            and(iszero(slt(x, 0)), slt(sum, y)),
            and(slt(x, 0), iszero(slt(sum, y)))
        ) { panic_error_0x11() }

    }

}
